import * as React from 'react';
import './banner.css';
import HomeBanner from '../img/home_banner.png';
import Bold from '../fonts/Montserrat-Bold.ttf'

export class Banner extends React.Component{
    render() {
        return (
            <div className="home-banner">
                <h1 className="title text-align-left col-5">Núcleo de Empreendedorismo da USP</h1>
                <p style={{font: {Bold}}}className="text-align-left col-5">Fomentando a cultura de empreendedorismo na Universidade de São Paulo</p>
            </div>
        )
    }
}
